content: "1\nDiovy Jehovah \xF4!\nIty havanay ity\nEsory ny ota izay natao,\nO! esory,\
  \ \xF4! esory\nNy ota natao.\nO! esory, \xF4! esory\nKa mba diovy\nIty havanay ity\n\
  Ho Anao. mm\u2026\n\n2\nTahio, Jehovah \xF4,\nIty havanay ity\nHo mendrika hanao\
  \ ny asanao.\nO! tahio, \xF4! tahio,\nHanao ny asanao.\nO! tahio, \xF4! tahio,\n\
  Tahio ry Ray \xF4\nIty havanay ity\nHo Anao. mm\u2026\n3\nHamasino, ry Ray\nIty\
  \ havanay ity\nHo mendrika hitondra ny Anaranao.\nHamasino, hamasino\nHo mendrika\
  \ Anao\nHamasino, hamasino\nO! hamasino\nIty havanay ity\nHo Anao. Amen!"
